import {
  IonButton,
  IonCol,
  IonGrid,
  IonInput,
  IonItem,
  IonLabel,
  IonRow,
} from "@ionic/react";
import React, { useState } from "react";

interface Agent {
  complexName: string;
  contractId: string;
  name: string;
  surname: string;
  id: string;
  cellNum: string;
  street1: string;
  street2: string;
  city: string;
  province: string;
  postalCode: string;
  password: string;
}

const AgentForm: React.FC<{ name: string; isDisabled: boolean; content: any}> = (props) => {
  const {
    agentId,
    complexName,
    contractId,
    name,
    surname,
    id,
    cellNum,
    street1,
    street2,
    city,
    province,
    postalCode,
    password} = props.content;

    const [enteredComplexName, setComplexName] = useState(complexName);
    const [enteredName, setName] = useState(name);
    const [enteredSurname, setSurname] = useState(surname);
    const [enteredId, setId] = useState(id);
    const [enteredCellNum, setCellNum] = useState(cellNum);
    const [enteredStreet1, setStreet1] = useState(street1);
    const [enteredStreet2, setStreet2] = useState(street2);
    const [enteredCity, setCity] = useState(city);
    const [enteredProvince, setProvince] = useState(province);
    const [enteredPostalCode, setPostalCode] = useState(postalCode);
    const [enteredPassword, setPassword] = useState('');
    const [enteredConfirm, setConfirmPassword] = useState('');

    const updateComplexName = (complexName: any) => setComplexName(complexName);
    const updateName = (name: any) => setName(name);
    const updateSurname = (surname: any) => setSurname(surname);
    const updateId = (id: any) => setId(id);
    const updateCellNum = (cellNum: any) => setCellNum(cellNum);
    const updateStreet1 = (street1: any) => setStreet1(street1);
    const updateStreet2 = (street2: any) => setStreet2(street2);
    const updateCity = (city: any) => setCity(city);
    const updateProvince = (province: any) => setProvince(province);
    const updatePostalCode = (postalCode: any) => setPostalCode(postalCode);
    const updatePassword = (password: any) => setPassword(password);
    const updateConfirm = (cPassword: any) => setConfirmPassword(cPassword);

  return (
    <IonGrid>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel position="floating">Name</IonLabel>
            <IonInput disabled={props.isDisabled} value={enteredName}/>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel position="floating">Surname</IonLabel>
            <IonInput disabled={props.isDisabled} value={enteredSurname}/>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel position="floating">ID</IonLabel>
            <IonInput disabled={props.isDisabled} value={enteredId}/>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel position="floating">Cell Number</IonLabel>
            <IonInput disabled={props.isDisabled} value={enteredCellNum}/>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel position="floating">Street 1</IonLabel>
            <IonInput disabled={props.isDisabled} value={enteredStreet1}/>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel position="floating">Street 2</IonLabel>
            <IonInput disabled={props.isDisabled} value={enteredStreet2}/>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel position="floating">City</IonLabel>
            <IonInput disabled={props.isDisabled} value={enteredCity}/>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel position="floating">Province</IonLabel>
            <IonInput disabled={props.isDisabled} value={enteredProvince}/>
          </IonItem>
        </IonCol>
        <IonCol>
          <IonItem>
            <IonLabel position="floating">Postal code</IonLabel>
            <IonInput disabled={props.isDisabled} value={enteredPostalCode}/>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel position="floating">Complex</IonLabel>
            <IonInput disabled={props.isDisabled} value={enteredComplexName}/>
          </IonItem>
        </IonCol>
        <IonCol>
          <IonItem>
            <IonLabel position="floating">Password</IonLabel>
            <IonInput type="password" disabled={props.isDisabled} value={enteredPassword}/>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel position="floating"> Confirm Password</IonLabel>
            <IonInput type="password" disabled={props.name === "Add"? props.isDisabled : true} value={enteredConfirm}/>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonButton type="submit" expand="block">
            {props.name}
          </IonButton>
        </IonCol>
      </IonRow>
    </IonGrid>
  );
};

export default AgentForm;
